import React, { useState } from "react";

import { BrowserRouter, Route, Link, Switch } from 'react-router-dom';
import Home from './Home.js';
import "./login.css";

class Login extends React.Component {




render () {
  return(
  <div> 

  <BrowserRouter>
  <nav>
     <Link Link to="/Home">
        <button type="button" onclick="this.style.display='none'">
          Submit!
        </button>
      </Link>
    </nav>
      <Switch>
            <Route path="/Home">
                <Home />
              </Route>

      </Switch>
  </BrowserRouter>
  </div>
  );
}
}

export default Login;
